function Car(props){
    return(
        <li>{props.brand}</li>
    );
}

function NewList(){
    const cars = ['Ford', 'BMW', 'Audi'];

    return(
        <>
            <ul>
                {cars.map((car) => <Car brand={car} />)}
            </ul>
        </>
    )
}

export default NewList;
